import React from 'react';
import water from '../assets/water.png';

export default function Water() {
    return (
        <div style={{
            width:'50%',
        }}>
            <img src={water} alt="Data Visuals" style={{
                width:'300px',
                height:'600px',
                alignContent: 'right'
            }}></img>
        </div>
    );
}
